  false,\n\t\"url\": null,\n\t\"notes\": \"The \"Turkey: Numbers and Locations of
  Externally Displaced Syrians\" map product was created by the U.S. Department of
  State Humanitarian Information Unit. It is current as of June 23, 2015.nnAccording
  to UNHCR, in 2014 Syria became the worldu2019s largest source country of refugees
  and Turkey became the largest host country of Syrians. The country-wide map shows
  the concentrations of displaced Syrians by province; the border region map shows
  the locations of refugee camps. An accompanying chart identifies the increase in
  registered Syrians in camps and urban areas.nnThis map product is hosted on State
  GeoNode at http://geonode.state.gov/documents/24.\",\n\t\"license_title\": null,\n\t\"extras\":
